import React from 'react';
import ItemStyles from './styles/itemStyles'
class Card extends React.Component {
    componentDidMount () {
        let test = this.props.CharacterData.map(char => (console.log(char.created))
        )
        console.log(test.split('-')[0])
    }
    render () {
        return (
                this.props.CharacterData.map(char => (

                    <ItemStyles>
                        <div className="image-container">
                            <img src={char.image} alt={char.title} />
                            <div className="char-name-container">
                                <h3>{char.name}</h3>
                                <span>ID: {char.id} </span>-<span> Created: {char.created}</span>
                            </div>
                        </div>

                    </ItemStyles> 
                ))
        )
    }
}

export default Card;
